import React from 'react'
import { ArrowsContainer,LeftArrow,RightArrow} from './ArrowsElements'

const Arrows = ({prevSlide,nextSlide}) => {
    return (
        <>
            <ArrowsContainer>
                <LeftArrow className="prev" onClick={prevSlide}/>
                <RightArrow className="next" onClick={nextSlide} />
            </ArrowsContainer>
        </>
    )
}

export default Arrows
